import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
const navbar = () => {
  return (
    <nav className="nav">
      <h3 className="doctor">DOCTORS' APPOINTMENT APP</h3>
      <ul className="nav-links">
        <Link to="/" className="Home">
          <li> Home </li>
        </Link>
      </ul>
    </nav>
  );
};
export default navbar;
